  fossil. Data organized by fuel type, i.e., coal, bituminous coal, subbituminous
  coal, lignite coal, petroleum liquids, petroleum coke, and natural gas. Also by
  sector, i.e., electric power, electric utility, independent power producers, commercial,
  and industrial. Annual, quarterly, and monthly data available.  Based on Form EIA-423
  and Form EIA-923 data. Users of the EIA API are required to obtain an API Key via
